(200, '1157', 'Sharlin', 'test', '<p>Your choice of font is important, but the <i>kind</i> of “family” you choose is project-specific, and we won’t discuss it here except to make one point: the conventional wisdom among Web designers that only <a href=\"https://en.wikipedia.org/wiki/Sans-serif\">sans-serif</a> fonts are suitable for body text is just a rule of thumb. Although serif fonts, with their greater complexity, may tend to be less effective at small sizes, there are many other factors to consider. A diminutive <a href=\"https://en.wikipedia.org/wiki/X-height\">x-height</a>, for example, could impair the readability of a font from either camp. Some serif fonts are highly legible and attractive for paragraph text if they are set properly. <a href=\"https://en.wikipedia.org/wiki/Matthew_Carter\">Matthew Carter’s</a> screen-sympathetic <a href=\"https://www.will-harris.com/verdana-georgia.htm\">Georgia</a> is a case in point.</p>', 'sent', '2023-08-08 14:37:26'),
